"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Syndrome of inappropriate antidiuretic hormone secretion (SIADH) (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H557160473\">",
"      <span class=\"h1\">",
"       What is the syndrome of inappropriate antidiuretic hormone secretion (SIADH)?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The syndrome of inappropriate antidiuretic hormone secretion (also called &ldquo;SIADH&rdquo;) is a condition that happens when your body makes too much antidiuretic hormone (also called &ldquo;ADH&rdquo;). ADH helps manage the amount of water in your body. If you have too much ADH, your kidneys can&rsquo;t get rid of water. Fluid builds up in your body and dilutes the amount of salt in your blood. This causes a condition called &ldquo;hyponatremia.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H557160488\">",
"      <span class=\"h1\">",
"       What causes SIADH?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many things can cause SIADH, including:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines &ndash; These include medicines used to treat type 2 diabetes, high blood pressure, seizures, and cancer.",
"       </li>",
"       <li>",
"        Infections such as pneumonia",
"       </li>",
"       <li>",
"        Surgery, especially on the bones and joints",
"       </li>",
"       <li>",
"        Brain and spinal cord problems &ndash; This includes strokes, bleeding, or an infection in your brain.",
"       </li>",
"       <li>",
"        Cancer &ndash; This includes different types of lung cancer (especially small cell) and cancer of the stomach, pancreas, or brain.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H557160505\">",
"      <span class=\"h1\">",
"       What are the symptoms of SIADH?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms are the same as the symptoms of hyponatremia and include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Nausea and vomiting",
"       </li>",
"       <li>",
"        Headache",
"       </li>",
"       <li>",
"        Confusion or trouble thinking clearly",
"       </li>",
"       <li>",
"        Feeling weak or tired",
"       </li>",
"       <li>",
"        Feeling restless or irritable",
"       </li>",
"       <li>",
"        Muscle weakness, spasms or cramps",
"       </li>",
"       <li>",
"        Seizures or passing out",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H557160520\">",
"      <span class=\"h1\">",
"       Is there a test for SIADH?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Tests include blood and urine tests.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H557160535\">",
"      <span class=\"h1\">",
"       How is SIADH treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on what is causing your SIADH. For example, if you have an infection, your doctor might prescribe medicines to treat it. He or she might also tell you to:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Limit the amount of fluids you drink",
"       </li>",
"       <li>",
"        Eat salt tablets or get a salt-water solution into a vein",
"       </li>",
"       <li>",
"        Stop taking a medicine that is causing the problem",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H557160550\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
