"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Barrett's esophagus (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/barretts-esophagus-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H29762311\">",
"      <span class=\"h1\">",
"       What is Barrett's esophagus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Barrett's esophagus is a condition that affects the esophagus (the tube that carries food from the mouth to the stomach) (",
"      <a class=\"graphic graphic_figure graphicRef55616 \" href=\"UTD.htm?28/22/29024\">",
"       figure 1",
"      </a>",
"      ). When people have Barrett's esophagus, the normal cells in the lower part of their esophagus are replaced by a different type of cell.",
"     </p>",
"     <p>",
"      Barrett's esophagus is usually caused by acid reflux. Acid reflux is when the acid that is normally in your stomach backs up into the esophagus. Many people with acid reflux never get Barrett's esophagus, but some do.",
"     </p>",
"     <p>",
"      If you have acid reflux, it's important to know if you also have Barrett's esophagus. That's because Barrett's esophagus can later turn into pre-cancer or cancer of the esophagus.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29762318\">",
"      <span class=\"h1\">",
"       What are the symptoms of Barrett's esophagus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Barrett's esophagus does not cause any symptoms. But people usually have symptoms from their acid reflux, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Burning in the chest, known as heartburn",
"       </li>",
"       <li>",
"        Burning in the throat or an acid taste in the throat",
"       </li>",
"       <li>",
"        Vomiting after eating",
"       </li>",
"       <li>",
"        Trouble swallowing",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29762325\">",
"      <span class=\"h1\">",
"       Is there a test for Barrett's esophagus?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor can do a test called an upper endoscopy to check for Barrett's esophagus.",
"     </p>",
"     <p>",
"      During an upper endoscopy, a doctor puts a thin tube with a camera and light on the end into your mouth and down into your esophagus (",
"      <a class=\"graphic graphic_figure graphicRef75392 \" href=\"UTD.htm?36/39/37490\">",
"       figure 2",
"      </a>",
"      ). He or she will look at the lining of the esophagus and take a small sample of it. Another doctor will look at the cells under a microscope to see if you have Barrett's esophagus.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29762332\">",
"      <span class=\"h1\">",
"       How is Barrett's esophagus treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Barrett's esophagus is treated by reducing or getting rid of a person's acid reflux. Treatment does not usually cure the Barrett's esophagus, but it keeps it from getting worse.",
"     </p>",
"     <p>",
"      Your doctor will likely give you medicines to stop your stomach from making acid. He or she might also recommend that you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Avoid caffeine drinks, alcohol, chocolate, peppermint, and fatty foods. These foods can make acid reflux worse.",
"       </li>",
"       <li>",
"        Avoid eating before going to bed, eating large meals, or lying down after eating",
"       </li>",
"       <li>",
"        Raise the head of your bed by 6 to 8 inches (for example, by putting wood blocks under 2 legs of the bed)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29762339\">",
"      <span class=\"h1\">",
"       Should I follow up with my doctor?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you have Barrett's esophagus, you should follow up with your doctor. He or she will keep checking that your Barrett's esophagus does not turn into pre-cancer or cancer.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29762346\">",
"      <span class=\"h1\">",
"       What if my Barrett's esophagus turns into pre-cancer or cancer?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If this happens, your doctor will talk with you about different ways to treat it.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29762353\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?24/2/24610?source=see_link\">",
"       Patient information: Acid reflux (gastroesophageal reflux disease) in adults (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?32/41/33426?source=see_link\">",
"       Patient information: Upper endoscopy (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?9/17/9491?source=see_link\">",
"       Patient information: Esophageal cancer (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?2/39/2676?source=see_link\">",
"       Patient information: Barrett's esophagus (Beyond the Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?37/30/38373?source=see_link\">",
"       Patient information: Acid reflux (gastroesophageal reflux disease) in adults (Beyond the Basics)",
"      </a>",
