var title_f13_29_13782="Indirect inguinal hernia";
var content_f13_29_13782=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F83013&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F83013&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Indirect inguinal hernia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 449px; height: 608px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Indirect hernias result from two anatomic defects: weakening of the fascia of the transversalis muscle fibers at the internal abdominal ring, and the potential space resulting from the a persistently patent processus vaginalis. In males, the obliteration of the processus vaginalis occurs during the first two years of life, but as many as 40 percent remain patent, 20 percent of which will later develop into inguinal hernias. The female counterpart of the processus vaginalis commonly disappears by eight months of gestation, although patency may persist into childhood. If patency persists, the patent processus is termed the canal of Nuck.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Harwood-Nuss A, Wolfson AB, et al. The Clinical Practice of Emergency Medicine, 3rd Edition. Philadelphia: Lippincott Williams &amp; Wilkins, 2001. Copyright &copy; 2001 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
