var title_f13_29_13788="Types of hysterectomy";
var content_f13_29_13788=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F57850&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F57850&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Types of hysterectomy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Subtotal/supracervical",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Subtotal/supracervical hysterectomy. The uterus is removed. The superior portion of the cervix is amputated, the remainder of the cervix is conserved. Intrafascial hysterectomy is a subtype of subtotal hysterectomy in which the uterosacral ligaments are conserved.",
"        <sup>",
"         [1]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Class l",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Extrafascial hysterectomy. The fascia of the cervix and lower uterine segment, which is rich in lymphatics, is removed with the uterus.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Class ll",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Modified radical hysterectomy. The uterine artery is ligated where it crosses over the ureter and the uterosacral and cardinal ligaments are divided midway towards their attachment to the sacrum and pelvic sidewall, respectively. The upper one-third of the vagina is resected.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Class lll",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Radical hysterectomy. The uterine artery is ligated at its origin from the superior vesical or internal iliac artery. Uterosacral and cardinal ligaments are resected at their attachments to the sacrum and pelvic sidewall. The upper one-half of the vagina is resected.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Class lV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Radical hysterectomy.The ureter is completely dissected from the vesicouterine ligament, the superior vesical artery is sacrificed, and three-fourths of the vagina is resected.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Class V",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Radical hysterectomy. There is additional resection of a portion of the bladder or distal ureter with ureteral reimplantation into the bladder.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Semm K. Hysterectomy via laparotomy or pelviscopy. A new CASH method without colpotomy (German). Geburtshilfe Frauenheilkd 1991; 51:996.",
"       </li>",
"       <li>",
"        Piver MS. Five classes of extended hysterectomy for women with cervical cancer. Obstet Gynecol 1974; 44:265.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
